import React from "react";

import { makeStyles } from "@material-ui/core/styles";
import {
  Card,
  CardContent,
  TextField,
  Typography,
  Button
} from "@material-ui/core";

const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1
  },
  menuButton: {
    marginRight: "24px"
  },
  title: {
    flexGrow: 1,
    margin: "24px"
  },
  test: {
    position: "relative",
    marginLeft: "24px",
    marginRight: "24px",
    padding: "100px",
    width: "100%",
    height: "100%"
  },
  loginCard: {
    justifyContent: "center",
    alignItems: "center",
    display: "flex",
    boxShadow: "0 3px 6px rgba(0,0,0,0.19), 0 3px 6px rgba(0,0,0,0.23)"
  },
  textField: {
    display: "flex",
    marginBottom: "30px",
    "& label.Mui-focused": {
      color: "green"
    }
  },
  submit: {
    margin: "auto",
    display: "inherit",
    width: "200px",
    height: "50px",
    borderRadius: "30px"
  }
}));
function Admin() {
  const classes = useStyles();
  return (
    <div className={classes.test}>
      <Card className={classes.loginCard}>
        <CardContent>
          <Typography
            className={classes.title}
            variant="h3"
            color="textPrimary"
          >
            L O G I N
          </Typography>
          <form noValidate autoComplete="off">
            <TextField
              className={classes.textField}
              id="standard-basic"
              label="ID"
            />
            <TextField
              className={classes.textField}
              id="standard-basic"
              label="Password"
              type="password"
            />
          </form>
          <Button className={classes.submit}>Login</Button>
        </CardContent>
      </Card>
    </div>
  );
}

export default Admin;
